def dichotomy(n, a):
    left = 0
    right = len(a) - 1  # 以索引为边界
    while left <= right:
        middle = (left + right) // 2  # 取一个在中间位置的索引
        if n > int(a[middle]):  # 如果要查找的数大于列表中索引在中间的元素
            left = middle + 1  # 重新定义边界,将左边界向右边挪一位
        elif n < int(a[middle]):  # 如果查找的数小于中间值
            right = middle - 1  # 重新定义边界,将右边界向左边挪一位
        else:  # 如果查找的数等于中间值,直接打印middle
            return middle
    else:
        return left - 1


def iptoint(ip):
    a = ip.split(".")
    return (int(a[0]) << 24) + (int(a[1]) << 16) + (int(a[2]) << 8) + (int(a[3]))


