    def dichotomy(self, n):
        return dichotomy(n, self.a)

    def iptoint(self, ip):
        return iptoint(ip)

    def checkip(self, ip):
        # 检查是否为境外ip
        # 国外<->True  国内<->False
        ip = self.iptoint(ip)
        sig = self.dichotomy(ip)
        if self.a[sig] <= ip <= self.b[sig]:
            return False
        else:
            return True
